Current_Quote_Days_S_1.query:
q = load "${App.Datasets.Quote_FOR_DEMO1.FullyQualifiedName}";
q = filter q by 'Account_ID' == "{{cell(Curr_Quote___Days_Si_1.result,0,"Account_ID").asObject()}}"; q = group q by all;
q = foreach q generate string_to_number("{{coalesce(cell(Curr_Quote___Days_Si_1.result,0,"sum_Days_Presented"),0).asObject()}}") as 'Current Quote', avg('Days_Presented') as 'avg_Days_Presented';
q = limit q 2000;

Get_Account_from_Cur_1.query:
q = load "${App.Datasets.Quote_FOR_DEMO1.FullyQualifiedName}";
result = group q by all;
result = foreach result generate first('Account_ID') as 'Account_ID';
result = limit result 1;

Quote_Margin_vs_Acco_1.query:
q = load "${App.Datasets.Quote_FOR_DEMO1.FullyQualifiedName}";
result = group q by all;
result = foreach result generate coalesce(sum(q.'Quote_Margin_Total'),0) as 'A', round({{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}},0) as 'B', round(abs(coalesce(sum(q.'Quote_Margin_Total'),0) - {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) / ((coalesce(sum(q.'Quote_Margin_Total'),0) + {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) /2)*100,0) as 'Percent Difference', round((abs(coalesce(sum(q.'Quote_Margin_Total'),0) - {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) / {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}})*100,0) as 'Percentage Change', (case when (round((abs(coalesce(sum(q.'Quote_Margin_Total'),0) - {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) / {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}})*100,0)) > 0 then "#3AE867" when (round((abs(coalesce(sum(q.'Quote_Margin_Total'),0) - {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) / {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}})*100,0)) <0 then "#E84340" else "#7D98B3" end) as 'color', (case when (round((abs(coalesce(sum(q.'Quote_Margin_Total'),0) - {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) / {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}})*100,0)) > 0 then "+" when (round((abs(coalesce(sum(q.'Quote_Margin_Total'),0) - {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}}) / {{coalesce(cell(Avg_Margin_for_Accou_1.result, 0, "avg_Quote_Margin_Total"),0).asString()}})*100,0)) <0 then "-" else "" end) as 'PlusOrminus';
result = limit result 2000;

